package com.taos.tdjava; import com.taosdata.jdbc.TSDBPreparedStatement; import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.SQLException;
import java.sql.Statement;
import java.util.ArrayList;
import java.util.Random; public class TestParamBind { private static Random r = new Random(); private static Connection getConnection() throws SQLException { Connection conn = DriverManager.getConnection("jdbc:TAOS://127.0.0.1:6030", "root", "taosdata"); return conn; } private static void createTable(Connection conn) throws SQLException { try(Statement stmt = conn.createStatement()) { stmt.executeUpdate("create database if not exists java_test"); stmt.executeUpdate("use java_test"); stmt.executeUpdate("drop table if exists weather"); stmt.executeUpdate("create stable if not exists " + "weather(ts timestamp, c1 int, c2 binary(10)) " + "tags(no int, location binary(10))"); } } public static void test() throws SQLException { try (Connection conn = getConnection()) { createTable(conn); // In the INSERT statement, // the VALUES clause allows you to specify a specific column; // If automatic table creation is adopted, // the TAGS clause needs to set the parameter values of all TAGS columns String psql = "insert into ? using weather tags (?, ?) (ts, c1, c2) values(?, ?, ?)"; try (TSDBPreparedStatement pst = (TSDBPreparedStatement) conn.prepareStatement(psql)) { pst.setTableName("w1"); // set tags pst.setTagInt(0, r.nextInt(10)); pst.setTagString(1, "Beijing"); int numOfRows = 10; // set values ArrayList<Long> ts = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { ts.add(System.currentTimeMillis() + i); } pst.setTimestamp(0, ts); ArrayList<Integer> s1 = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { s1.add(r.nextInt(100)); } pst.setInt(1, s1); ArrayList<String> s2 = new ArrayList<>(); for (int i = 0; i < numOfRows; i++) { s2.add("test" + r.nextInt(100)); } pst.setString(2, s2, 10); // The cache is not cleared after AddBatch. Do not bind new data again before ExecuteBatch pst.columnDataAddBatch(); pst.columnDataExecuteBatch(); // Clear the cache, after which you can bind new data(including table names, tags, values): pst.columnDataClearBatch(); pst.columnDataCloseBatch(); } } } public static void main(String[] args) { try { test(); } catch (SQLException e) { e.printStackTrace(); } }
} Result: taos> select tbname, * from weather; tbname | ts | c1 | c2 | no | location |
================================================================================================================= w1 | 2021-12-20 12:11:28.277 | 16 | test64 | 7 | Beijing | w1 | 2021-12-20 12:11:28.278 | 87 | test21 | 7 | Beijing | w1 | 2021-12-20 12:11:28.279 | 5 | test41 | 7 | Beijing | w1 | 2021-12-20 12:11:28.280 | 34 | test44 | 7 | Beijing | w1 | 2021-12-20 12:11:28.281 | 96 | test19 | 7 | Beijing | w1 | 2021-12-20 12:11:28.282 | 29 | test0 | 7 | Beijing | w1 | 2021-12-20 12:11:28.283 | 66 | test59 | 7 | Beijing | w1 | 2021-12-20 12:11:28.284 | 41 | test64 | 7 | Beijing | w1 | 2021-12-20 12:11:28.285 | 78 | test88 | 7 | Beijing | w1 | 2021-12-20 12:11:28.286 | 28 | test45 | 7 | Beijing |
